import React from 'react';
import CheckIcon from '@material-ui/icons/Check';
import DeleteIcon from '@material-ui/icons/Delete';

const List = (props) => {
  const check = () => {
    line(true);
  };
  return (
    <ol>
      <li>{props.text}</li>
      <span className='list_btn'>
        <span className='ch_btn' onClick={check}>
          <CheckIcon
            className='ch_btn btn'
            slyle={{ textDecoration: line ? 'line-trough' : 'none' }}
          />
        </span>
        <DeleteIcon className='del_btn btn' />
      </span>
    </ol>
  );
};

export default List;
